Insert into SYSTEM.FAITS_OEUVRE (ID_OEUVRE,ID_AUTEUR,ID_ACQUISITION,ID_DOMAINE,ID_DIMENSIONS,DATE_CREATION,TITRE,TECHNIQUE,NO_INVENTAIRE,LIEN_NAVIGART,PRECISIONS_ACQUISITION) values ('18','Antoine-Jean GROS','(1854,Don)','2','136,1 x 196,4 x 3','1801','Le combat de Nazareth','La scène représente la fin du combat où le général Junot commanda les cinq cents Français, vainqueurs à Nazareth, de dix mille Turcs. On voit Junot un peu à gauche, montant un cheval blanc fougueux et sabrant un ennemi, après en avoir abattu un autre d''un coup de pistolet. Le chef de brigade Desnoyers passe au galop devant le général et donne des ordres aux fantassins qui repoussent une charge furieuse des Turcs. Au fond à droite, les dragons du chef de brigade Duvivier exécutent une charge. A gauche, dans la plaine, des ennemis en déroute. Sur le devant de la composition, nombreux épisodes de combats isolés ; des cadavres, des blessés, des chevaux. A l''horizon, la silhouette du Mont Thabor ; en face, le village de Cana.Huile sur toile','1005','https://www.stg.navigart.fr/museedartsdenantes/#/artwork/110000000004185','Don de M. Urvoy de Saint-Bedan en 1854');
