Insert into SYSTEM.FAITS_OEUVRE (ID_OEUVRE,ID_AUTEUR,ID_ACQUISITION,ID_DOMAINE,ID_DIMENSIONS,DATE_CREATION,TITRE,TECHNIQUE,NO_INVENTAIRE,LIEN_NAVIGART,PRECISIONS_ACQUISITION) values ('1947','Paul Albert BESNARD','(1923,Achat)','2','116.3 x 98,6','1913','Nymphe endormie (nu aux lapins)','Albert Besnard rejoint l’atelier de Cabanel à l’Ecole des Beaux-arts dès ses 17 ans. Il expose pour la première fois au Salon de 1868. En 1874, La mort de Timophane, tyran de Corinthe, lui vaut le Grand Prix de Rome. Il connaît ensuite une carrière brillante : directeur de la Villa Médicis en 1913, puis de l’Ecole des Beaux-arts de Paris en 1922 ; élu à l’Académie française. Décorateur, Besnard peint de grandes compositions à Paris pour l’Hôtel de Ville, l’Ecole de Pharmacie, la Comédie française, le Petit Palais, etc. Son œuvre est marqué par la recherche de la lumière. Regardant l’impressionnisme sans y adhérer, Besnard travaille les éclairages audacieux et une palette claire, faisant dire aux critiques qu’il réalise des « feux d’artifice ».« Caractéristique peinture de chevalet du Maître A. Besnard » (Léonce Bénédite), cette étonnante Nymphe endormie a été achetée en 1923 par le musée, qui conserve également un pastel de l’artiste.Huile sur toile','2003','https://www.stg.navigart.fr/museedartsdenantes/#/artwork/110000000001232','Achat en 1923');
