Insert into SYSTEM.FAITS_OEUVRE (ID_OEUVRE,ID_AUTEUR,ID_ACQUISITION,ID_DOMAINE,ID_DIMENSIONS,DATE_CREATION,TITRE,TECHNIQUE,NO_INVENTAIRE,LIEN_NAVIGART,PRECISIONS_ACQUISITION) values ('3351','Hippolyte Dominique BERTEAUX','(1904,Achat)','2','775 x 2100','1904','Bretagne mystique (panneau décoratif)','Sur une route qui suit le flanc d''une falaise, un cortège allant de gauche à droite. En tête, un porte-croix entre deux enfants de choeur portant des cierges, puis des tambours que suivent des femmes en costume de deuil avec des voiles noirs, puis d''autres femmes en costume de bretonnes, tenant des cierges. A peu de distance de ce premier groupe, vient un porte-étendard portant la bannière de Sainte-Anne flottant au vent ; il est précédé d''un enfant et accompagné d''un vieillard tenant un cierge. Derrière, sont quatre marins portant sur leurs épaules un brancard sur lequel est posé un bateau de pêche aux voiles déployées. La procession se continue par des groupes de femmes, les unes portant des bannières, les autres tenant les cordons, d''autres portant une châsse en forme de cathédrale et ainsi de suite jusqu''au tournant d''e la route. A gauche, la mer d''une tonalité jaunâtre. L''ensemble du panneau est compris dans une tonalité gris bleu ardoiséHuile sur toile marouflée','812','https://www.stg.navigart.fr/museedartsdenantes/#/artwork/110000000004051','Achat par commande à l''artiste en 1904');
